syntax = "proto2";

package com.inbox;

option optimize_for = SPEED;
option java_package = "com.binance.ws.messages.protobuf.com.inbox";
option java_multiple_files = true;
option java_outer_classname = "InboxMsgRespProto";
import "com/inbox/InboxMsg.proto";

message InboxMsgResp {
  optional int32 total = 1;
  repeated InboxMsg messages = 2;
}
